int managePlaneCollision(){
    //Bouncing planes off each other
    if(ABS(red.y - blue.y) < 5){
        red.dX = -red.dX;
        blue.dX = -blue.dX;
        return -1;
    } else if(red.y < blue.y){
        red.score++;
        return 0;
    } else {
        blue.score++;
        return 1;
    }
}

